INSERT INTO `mdl_question` VALUES (1,1,0,'Question','<p>What will be the output of the following program?</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span>#include&lt;stdio.h&gt;</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span>int main(){</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span>int i=2;</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span>++i,i/2,i*=i;</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span>printf(\"%d\\n\",i);</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span>}</p>',1,'',1,4.0000000,0.3333333,'multichoice',1,'online.ritcsa.ml+160803124852+IkvT6P','online.ritcsa.ml+160803124853+9i3bT9',0,1470228532,1470228532,34,34),(2,1,0,'Question','<p>What will be the output of the following program?</p><p>#include&lt;stdio.h&gt;<br></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span>int main(){</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span>char s[6]=\"world\";</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span>int i,j;</p><p>for(i=0,j=5;i&lt;j;s[i++]=s[j--]);<br></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span>printf(\"%s\\n\",s);</p><p>}<br></p><p><br></p>',1,'',1,4.0000000,0.3333333,'multichoice',1,'online.ritcsa.ml+160803125611+5ftYMp','online.ritcsa.ml+160803125735+vmv28Z',0,1470