pre\"><span style=\"white-space: normal;\">			</span></span>for(i=0;i&lt;5;++i)</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">				</span></span>printf(\"%d \",a[i]);</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span>}</p>',1,'',1,4.0000000,0.3333333,'multichoice',1,'online.ritcsa.ml+160803130311+AuKKB3','online.ritcsa.ml+160803130311+EXZ87u',0,1470229391,1470229391,34,34),(5,2,0,'Question','<p>How many times the program will print \"Hello World\" ?</p><p>#include&lt;stdio.h&gt;</p><p>int main()<br></p><p>{</p><p>&nbsp; &nbsp; printf(\"Hello World\");</p><p>&nbsp; &nbsp; main();</p><p>&nbsp; &nbsp; return 0;</p><p>}</p>',1,'',1,4.0000000,0.3333333,'multichoice',1,'online.ritcsa.ml+160803130645+F3uDJC','online.ritcsa.ml+160803130645+MjOfZD',0,1470229605,1470229605,34,34),(6,2,0,'Question','<p>What will be the output of the following program?</p><p><br></p><p>#include&lt;stdio.h&gt;</p><p>int main(){<br></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span>int a=20,i;</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span>for(i=0;a;a&gt;&gt;=1)</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span>++i;</p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span>printf(\"%d\\n\",i);</p><p>}</p>',1,'',1,4.0000000,0.3333333,'multichoice',1,'online.ritcsa.ml+160803130936+nlQtDa','online.ritcsa.ml+160803130936+dceWOG',0,1470229776,1470229776,34,34),(7,2,0,'Question','<p>What will be the output of the following program?</p><p>#include&lt;stdio.h&gt;</p><p>int main(){<br></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span></p><p><span style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span>int n=123456;</p><p><span style=