at is the output of this program?\n\n#include<stdio.h>\n\n#include<string.h>\n\nint main(){\n\n char a[]=\"abcde\";\n\n char b[]=\"abcdd\";\n\n int x;\n\n x=strcmp(a,b);\n\n printf(\"%d\",x);\n\n}\n: Segmentation Fault\n; 1\n; 0\n; -1\n','1\n',NULL,1473970737),(2391,61,29,'deferredfeedback',189,1,4.0000000,-0.2500000,1.0000000,0,'What will be the output of the program?\n\n#include<stdio.h>\n\n#define SQR(x)(x*x)\n\nint main()\n\n{\n\n  int a, b=3;\n\n  a = SQR(b+2);\n\n  printf(\"%d\\n\", a);\n\n  return 0;\n\n}\n: Garbage value\n\n; Error\n; 25\n; 11\n','11\n',NULL,1473970737),(2392,61,30,'deferredfeedback',190,1,4.0000000,-0.2500000,1.0000000,0,'The number of tokens in the following C statement.\n\nprintf(\"i = %d, &i = %x\", i, &i);\n\n: 26\n; 10\n; 3\n; 21\n','10\n',NULL,1473970737),(2393,61,31,'deferredfeedback',191,1,4.0000000,-0.2500000,1.0000000,0,'What will be output of the following code?\n\nvoid main(){\n\n int i=10;\n\n static int x=i;\n\n if(x==i)\n\n   printf(\"Equal\");\n\n else if(x>i)\n\n   printf(\"Greater than\");\n\n else\n\n   printf(\"Less than\");\n\n}\n: Equal\n\n; Less than\n\n; None of above\n\n; Greater than\n\n','None of above\n\n',NULL,1473970737),(2394,61,32,'deferredfeedback',192,1,4.0000000,-0.2500000,1.0000000,0,'What will be the output of the following program?\n\n#include<stdio.h>\n\n#include<string.h>\n\nint main(){\n\n int a[]={1,1,2,2,3,3,4,4,5};\n\n int i,ans=0;\n\n for(i=0;i<9;++i)\n\n ans^=a[i];\n\n printf(\"%d\",ans);\n\n}\n\n: 10\n; 5\n; 0\n; 1\n','5\n',NULL,1473970737),(2395,61,33,'deferredfeedback',193,1,4.0000000,-0.2500000,1.0000000,0,'What does the following fragment of C-program print?\n\nchar c[] = \"abcdefgh\";\n\nchar *p =c;\n\nprintf(\"%s\", p + p[3] - p[1]) ;\n\n: cdefgh\n\n; fgh\n; abcdefgh\n\n; efgh\n','cdefgh\n\n',NULL,1473970737),(2396,61,34,'deferredfeedback',194,1,4.0000000,-0.2500000,1.0000000,0,'What is the output?\n\n#include<stdio.h>\n\n#include<string.h>\n\nint main(){\n\n int a=9876543,ans=0;\n\n a&1?++ans:--ans;\n\n printf(\"%d\",ans);\n\n}\n\n: -1\n; 2\n; 0\n; 1\n','1\n',NULL,1473970737),(2397,61,35,'deferredfeedback',195,1,4.0000000,-0.2500000,1.0000000,0,'Consider the following C-program fragment in which i, j and n are integer variables.\n\nfor (i = n, j = 0; i >0; i /= 2, j += i);\n\nLet val(j) denote the value stored in the variable j after termination of the for loop. Which one of the following is true?\n: val(j) = T(nlogn)\n\n; val(j) = T(n)\n\n; val(j) = T(logn)\n\n; vaI(j) = T(sqrt(n))\n\n','val(j) = T(n)\n\n',NULL,1473970737),(2398,61,36,'deferredfeedback',196,1,4.0000000,-0.2500000,1.0000000,0,'The C language is ..\n\n: A regular language\n\n; Parsable fully only by a Turing machine\n\n; A context free language\n\n; A context sensitive language\n\n','A context free language\n\n',NULL,1473970737),(2399,61,37,'deferredfeedback',197,1,4.0000000,-0.2500000,1.0000000,0,'Consider the following C declaration\n\nstruct {\n\n  short s [5]\n\n  union {\n\n    float y;\n\n    long z;\n\n  }u;\n\n} t;\n\nAssume that objects of the type short, float and long occupy 2 bytes, 4 bytes and 8 bytes, respectively. The memory requirement for variable t, ignoring alignment\n\nconsiderations, is\n: 18 bytes\n\n; 14 bytes\n\n; 22 bytes\n\n; 10 bytes\n\n','18 bytes\n\n',NULL,1473970737),(2400,61,38,'deferredfeedback',198,1,4.0000000,-0.2500000,1.0000000,0,'What is the output of following program?\n\n#include<stdio.h>\n\nint main(void)\n\n{\n\n char *ptr = \"Linux\";\n\n  *ptr = \'T\';\n\n  printf(\"\\n [%s] \\n\", ptr);\n\n  return 0;\n\n}\n: Segmentation fault\n\n; inux\n\n; Tinux\n\n; Linux\n\n','Segmentation fault\n\n',NULL,1473970737),(2401,61,39,'deferredfeedback',199,1,4.0000000,-0.2500000,1.0000000,0,'What will be the output of following program?\n\n#include<stdio.h>\n\nvoid foo(char *dest, const char *src)\n\n{\n\n  while (*dest!= \'\\0\')\n\n    *dest++ ;\n\n  do\n\n  {\n\n    *dest++ = *src++;\n\n  }\n\n  while (*src != \'\\0\') ;\n\n}\n\nint main(){\n\n char a[10]=\"11\";\n\n char b[10]=\"12\";\n\n foo(a,b);\n\n printf(\"%s\",a);\n\n}\n: 12\n; 1112\n; Segmentation Fault\n\n; 11\n','1112\n',NULL,1473970737),(2402,61,40,'deferredfeedback',200,1,4.0000000,-0.2500000,1.0000000,0,'Which library function can convert aninteger/longto astring?\n\n: ultoa()\n; None of the above\n; ltoa()\n; sprintf()\n','ltoa()\n',NULL,1473970737);
